import Link from "next/link";

function HomePage() {
  return (
    <div>
      <h1>Welcome to Next.js!</h1>
      <ul>
        <li>
          <Link href="/about">Go To About</Link>
        </li>
        <li>
          <Link href="/blog">Go To Blog</Link>
        </li>
      </ul>
    </div>
  );
}

export default HomePage;
